class Exercicio1466
{
    /**
     * @param Integer $n
     * @param Integer[][] $connections
     * @return Integer
     */
    function minReorder($n, $connections) {
        $graph = [];
        $digraph = [];
        $visited = [];

        for ($i = 0; $i < $n - 1; $i++) {
            $visited[$i] = 0;
            $connection = $connections[$i];
            $digraph[$connection[0]][$connection[1]] = 1;
            $graph[$connection[0]][$connection[1]] = 1;
            $graph[$connection[1]][$connection[0]] = 1;
        }

        $count = 0;
        $queue = [];
        $queue[] = 0;

        while (!empty($queue)) {
            $node = array_shift($queue);
            $visited[$node] = 1;

            foreach ($graph[$node] as $adjacency => $isConnected) {
                if (!$isConnected) continue;
                if ($visited[$adjacency] ?? false) continue;
                if (($digraph[$node][$adjacency] ?? null) === 1) $count++;

                $queue[] = $adjacency;
            }
        }

        return $count;
    }
}

